import "./Resume.css";

const Resume = () => {
  return (
    <section className="resume" id="resume">
      <h2>Resume</h2>

      <div className="resume-grid">
        <div className="resume-card">
          <h3>Frontend</h3>
          <p>HTML, CSS, JavaScript</p>
          <p>React, Tailwind</p>
        </div>

        <div className="resume-card">
          <h3>Backend</h3>
          <p>Node.js, Express</p>
          <p>MongoDB</p>
        </div>

        <div className="resume-card">
          <h3>Tools</h3>
          <p>Git, GitHub</p>
          <p>VS Code</p>
        </div>
      </div>
    </section>
  );
};

export default Resume;
